      out.write("							<td style=\"text-align: left\">\r\n");
      out.write("								<p><strong>이름을 입력해주세요.</strong>&nbsp;&nbsp;&nbsp;<span id=\"nameChk\"></span></p>\r\n");
      out.write("							</td>\r\n");
      out.write("						</tr>\r\n");
      out.write("						<tr>\r\n");
      out.write("							<td><input type=\"text\" name=\"userName\" id=\"user_name\"\r\n");
      out.write("								class=\"form-control tooltipstered\" maxlength=\"6\"\r\n");
      out.write("								required=\"required\" aria-required=\"true\"\r\n");
      out.write("								style=\"margin-bottom: 25px; width: 100%; height: 40px; border: 1px solid #d9d9de\"\r\n");
      out.write("								placeholder=\"한글로 최대 6자\"></td>\r\n");
      out.write("						</tr>\r\n");
