      out.write("</div>\r\n");
      out.write("\r\n");
      out.write("<script>\n");
      out.write("\r\n");
      out.write("	//start-jQuery\r\n");
      out.write("	$(function() {\r\n");
      out.write("		\r\n");
      out.write("		//각 입력값들의 유효성 검증을 위한 정규표현식을 변수로 선언. //정규 표현식(Regular Expression) 줄여서 RegExp\r\n");
      out.write("		// /^가 시작 $/ 끝을 의미. []안에 작성된 내용은 허용된 문자 {} 글자의 길이\r\n");
      out.write("	    const getIdCheck = RegExp(/^[a-zA-Z0-9]{4,14}$/);\r\n");
      out.write("	    const getPwCheck = RegExp(/([a-zA-Z0-9].*[!,@,#,$,%,^,&,*,?,_,~])|([!,@,#,$,%,^,&,*,?,_,~].*[a-zA-Z0-9])/);\r\n");
      out.write("	    const getNameCheck = RegExp(/^[가-힣]+$/);\r\n");
      out.write("	    \r\n");
      out.write("	    //입력값 중 하나라도 만족하지 못한다면 회원가입 처리를 막기 위한 논리형 변수 선언\r\n");
      out.write("	    let chk1 = false; chk2 = false; chk3 = false; chk4 = false;\r\n");
      out.write("		\r\n");
      out.write("		//회원 가입 시 사용자의 입력값들을 검증!\r\n");
      out.write("		\r\n");
      out.write("		//1. ID 입력값 검증\r\n");
      out.write("		$('#user_id').keyup(function() {\r\n");
      out.write("			if($(this).val() === '') {\r\n");
      out.write("				$(this).css('background', 'pink');\r\n");
      out.write("				$('#idChk').html('<b style=\"font-size: 14px; color: red\">[아이디는 필수 정보입니다!]</b>');\r\n");
      out.write("				chk1 = false;\r\n");
      out.write("			}\r\n");
      out.write("			//아이디 입력값 유효성 검증 (영문, 숫자로만 4~14글자 허용)\r\n");
      out.write("			//정규표현식변수.test('검증하고 싶은 값') -> return boolean type으로 리턴\r\n");
      out.write("			//정규표현식에 어긋난 값이면 false, 올바른 값이면 true\r\n");
      out.write("			else if(!getIdCheck.test($(this).val( ))) {\r\n");
      out.write("				$(this).css('background', 'pink');\r\n");
      out.write("				$('#idChk').html('<b style=\"font-size: 14px; color: red\">[영문자, 숫자조합 4-14자!]</b>');\r\n");
      out.write("				chk1 = false;\r\n");
      out.write("			}\r\n");
      out.write("			//ID 중복 확인 (비동기 처리)\r\n");
      out.write("			//비동기 : 특정 로직의 실행이 끝날 때 까지 기다리지 않고 먼저 코드를 실행.(페이지 전환 없이 통신)\r\n");
      out.write("			else {\r\n");
      out.write("				//ID 중복 확인 통신을 위해 사용자의 입력값을 먼저 가져오기\r\n");
      out.write("				const id = $(this).val();\r\n");
      out.write("				\r\n");
      out.write("				//ajax 호출.\r\n");
      out.write("				//클라이언트에서 서버와 비동기 통신을 진행하게 도와주는 ajax함수\r\n");
      out.write("				$.ajax({\r\n");
      out.write("					type: 'POST', //서버에 전송하는 HTTP 방식\r\n");
      out.write("					url: '/user/checkId', //서버 요청 url\r\n");
      out.write("					headers: {\r\n");
      out.write("						'Content-Type': 'application/json'\r\n");
      out.write("					},\r\n");
      out.write("					dataType: 'text', //서버로부터 응답받을 데이터의 형태\r\n");
      out.write("					data: id, //서버로 전송할 데이터. 위에 선언한 변수명 id\r\n");
      out.write("					success: function(result) { //매개변수에 통신 성공 시 리턴되는 데이터가 저장됨.\r\n");
      out.write("						//서버와 통신 성공 시 실행할 내용.\r\n");
      out.write("						console.log('통신 성공!' + result);\r\n");
      out.write("						if(result === 'available') {\r\n");
      out.write("							$('#user_id').css('background', 'aqua');\r\n");
      out.write("							$('#idChk').html('<b style=\"font-size: 14px; color: green\">[아이디 사용이 가능합니다.]</b>');\r\n");
      out.write("							chk1 = true;\r\n");
      out.write("						} else {\r\n");
      out.write("							$('#user_id').css('background', 'pink');\r\n");
      out.write("							$('#idChk').html('<b style=\"font-size: 14px; color: red\">[아이디가 중복되었습니다.]</b>');\r\n");
      out.write("							chk1 = false;\r\n");
      out.write("						}\r\n");
      out.write("					},\r\n");
      out.write("					error: function(status, error) { //통신에 실패시 실행 할 로직\r\n");
      out.write("						console.log('통신 실패!');\r\n");
      out.write("						console.log(status, error);\r\n");
      out.write("					}\r\n");
      out.write("				}); //end ajax (아이디 중복 확인 비동기)\r\n");
      out.write("			}\r\n");
      out.write("		}); //아이디 검증 끝. keyup function\r\n");
      out.write("		\r\n");
      out.write("		//2. 패스워드 입력값 검증.\r\n");
      out.write("		$('#password').keyup(function() {\r\n");
      out.write("			\r\n");
      out.write("			//비밀번호란 공백 확인.\r\n");
      out.write("			if($(this).val() === '') {\r\n");
      out.write("				$(this).css('background', 'pink');\r\n");
      out.write("				$('#pwChk').html('<b style=\"font-size: 14px; color: red\">[비밀번호는 필수 정보입니다.]</b>');\r\n");
      out.write("				chk2 = false;\r\n");
      out.write("			} \r\n");
      out.write("			//비밀번호 유효성 검사\r\n");
      out.write("			else if(!getPwCheck.test($(this).val()) || $(this).val().length < 8) {\r\n");
      out.write("				$(this).css('background', 'pink');\r\n");
      out.write("				$('#pwChk').html('<b style=\"font-size: 14px; color: red\">[특수문자 포함 8자 이상]</b>');\r\n");
      out.write("				chk2 = false;\r\n");
      out.write("			}\r\n");
      out.write("			//통과\r\n");
      out.write("			else {\r\n");
      out.write("				$(this).css('background', 'aqua');\r\n");
      out.write("				$('#pwChk').html('<b style=\"font-size: 14px; color: green\">[비밀번호 입력 완료]</b>');\r\n");
      out.write("				chk2 = true;\r\n");
      out.write("			}\r\n");
      out.write("			\r\n");
      out.write("		}); //비밀번호 검증 끝.\r\n");
      out.write("		\r\n");
      out.write("		//3. 비밀번호 확인란 검증\r\n");
      out.write("		$('#password_check').keyup(function() {\r\n");
      out.write("			//비밀번호 확인란 공백 검증\r\n");
      out.write("			if($(this).val() === '') {\r\n");
      out.write("				$(this).css('background', 'pink');\r\n");
      out.write("				$('#pwChk2').html('<b style=\"font-size: 14px; color: red\">[비밀번호 확인은 필수 정보입니다.]</b>');\r\n");
      out.write("				chk3 = false;\r\n");
      out.write("			}\r\n");
      out.write("			//위에 작성된 비밀번호 확인란 유효성 검사\r\n");
      out.write("			else if($(this).val() !== $('#password').val()) {\r\n");
      out.write("				$(this).css('background', 'pink');\r\n");
      out.write("				$('#pwChk2').html('<b style=\"font-size: 14px; color: red\">[비밀번호와 일치하지 않습니다.]</b>');\r\n");
      out.write("				chk3 = false;\r\n");
      out.write("			} else {\r\n");
      out.write("				$(this).css('background', 'aqua');\r\n");
      out.write("				$('#pwChk2').html('<b style=\"font-size: 14px; color: green\">[비밀번호 확인 완료]</b>');\r\n");
      out.write("				chk3 = true;\r\n");
      out.write("			}\r\n");
      out.write("			\r\n");
      out.write("		}); //비밀번호 확인 검증 끝.\r\n");
      out.write("		\r\n");
      out.write("		//4. 이름 입력값 검증\r\n");
      out.write("		$('#user_name').keyup(function() {\r\n");
      out.write("			//이름 값 공백 확인\r\n");
      out.write("			if($(this).val() === '') {\r\n");
      out.write("				$(this).css('background', 'pink');\r\n");
      out.write("				$('#nameChk').html('<b style=\"font-size: 14px; color: red\">[이름은 필수 정보입니다.]</b>');\r\n");
      out.write("				chk4 = false;\r\n");
      out.write("			}\r\n");
      out.write("			//이름값 유효성 검사\r\n");
      out.write("			else if(!getNameCheck.test($(this).val())) {\r\n");
      out.write("				$(this).css('background', 'pink');\r\n");
      out.write("				$('#nameChk').html('<b style=\"font-size: 14px; color: red\">[이름은 한글로만 작성하세요]</b>');\r\n");
      out.write("				chk4 = false;\r\n");
      out.write("			} else {\r\n");
      out.write("				$(this).css('background', 'aqua');\r\n");
      out.write("				$('#nameChk').html('<b style=\"font-size: 14px; color: green\">[이름 입력 완료]</b>');\r\n");
      out.write("				chk4 = true;\r\n");
      out.write("			}\r\n");
      out.write("			\r\n");
      out.write("		}); //이름 입력 검증 끝.\r\n");
      out.write("		\r\n");
      out.write("		//사용자가 회원 가입 버튼을 눌렀을 때의 이벤트 처리\r\n");
      out.write("		//사용자가 입력하는 4가지 데이터중 단 하나라도 문제가 있다면 회원가입 처리를 해주지 말아야 한다.\r\n");
      out.write("		$('#signup-btn').click(function() {\r\n");
      out.write("			if(chk1 && chk2 && chk3 && chk4) {\r\n");
      out.write("				//아이디 정보\r\n");
      out.write("				const id = $('#user_id').val();\r\n");
      out.write("				//비밀번호 정보\r\n");
      out.write("				const pw = $('#password').val();\r\n");
      out.write("				//이름정보\r\n");
      out.write("				const name = $('#user_name').val();\r\n");
      out.write("				\r\n");
      out.write("				//여러개의 값을 보낼 때는 객체로 포장해서 전송\r\n");
      out.write("				//property 이름은 VO 객체의 변수명과 동일하게 (커맨드 객체 사용을 위해)\r\n");
      out.write("				const user = {\r\n");
      out.write("					'account': id,\r\n");
      out.write("					'password': pw,\r\n");
      out.write("					'name': name\r\n");
      out.write("				};\r\n");
      out.write("				\r\n");
      out.write("				//비동기 통신 시작\r\n");
      out.write("				$.ajax({\r\n");
      out.write("					type: 'POST',\r\n");
      out.write("					url: '/user/',\r\n");
      out.write("					contentType:  'application/json',\r\n");
      out.write("					dataType: 'text',\r\n");
      out.write("					//JavaScript 객체를 JSON 문자열로 변환해 주는 메소드\r\n");
      out.write("					data: JSON.stringify(user),\r\n");
      out.write("					success: function(result) {\r\n");
      out.write("						console.log('통신 성공!: ' + result);\r\n");
      out.write("						alert('회원가입을 환영합니다.');\r\n");
      out.write("						location.href='/'; // '/' = home.jsp을 보여준다.\r\n");
      out.write("					},\r\n");
      out.write("					error: function() {\r\n");
      out.write("						alert('회원가입 실패');\r\n");
      out.write("					}\r\n");
      out.write("				}); //end ajax (회원 가입 처리)\r\n");
      out.write("				\r\n");
      out.write("			} else { //입력값 4가지 중 하나라도 false라면\r\n");
      out.write("				alert('입력 정보를 다시 확인하세요');\r\n");
      out.write("			}\r\n");
      out.write("		}); //회원가입 처리 끝.\r\n");
      out.write("		\r\n");
      out.write("		//////////////////////////////////////////////////\r\n");
      out.write("		\r\n");
      out.write("		//로그인 검증\r\n");
      out.write("		//ID 입력값 검증(공백, 정규표현식)\r\n");
      out.write("	      $('#signInId').keyup(function() {\r\n");
      out.write("	         if($(this).val() === '') {\r\n");
      out.write("	            $(this).css('background-color', 'pink');\r\n");
      out.write("	            $('#idCheck').html('<b style=\"font-size: 14px; color: red\">[아이디는 필수 정보입니다!]</b>');\r\n");
      out.write("	            chk1 = false;\r\n");
      out.write("	         } else if(!getIdCheck.test($(this).val())) {\r\n");
      out.write("	            $(this).css('background-color', 'pink');\r\n");
      out.write("	            $('#idCheck').html('<b style=\"font-size: 14px; color: red\">[영문, 숫자로 4-14자로 작성!]</b>');\r\n");
      out.write("	            chk1 = false;\r\n");
      out.write("	         } else {\r\n");
      out.write("	            $(this).css('background-color', 'aqua');\r\n");
      out.write("	            $('#idCheck').html('<b style=\"font-size: 14px; color: green\">[아이디 입력 완료!]</b>');\r\n");
      out.write("	            chk1 = true;\r\n");
      out.write("	         }\r\n");
      out.write("	      }); //아이디 입력값 검증 끝!\r\n");
      out.write("	      \r\n");
      out.write("	      //비밀번호 입력값 검증(공백, 정규표현식)\r\n");
      out.write("	      $('#signInPw').keyup(function() {\r\n");
      out.write("	         if($(this).val() === '') {\r\n");
